import React, { useState, useEffect } from 'react';
import { useTheme } from '../../context/ThemeContext';
import './Navigation.css';
import Button from '../Button/Button';
import logo from '../../assets/techsaas-logo.webp';

const Navigation = ({ toggleModal, userName, onTierSelect }) => {
  const { theme, setTheme } = useTheme();
  const [isDarkMode, setIsDarkMode] = useState(false);

  const handleDarkModeToggle = () => {
    setIsDarkMode(!isDarkMode);
    setTheme(isDarkMode ? 'default' : 'dark');
  };

  return (
    <nav className={`navigation ${isDarkMode ? 'dark' : 'light'}`}>
      <div className="nav-logo">
        <a href="/">
          <img src={logo} alt="TechSaas Vision" />
        </a>
      </div>
      <ul className="nav-links">
        <li>
          <a href="/services">Services</a>
        </li>
        <li>
          <a href="/portfolio">Portfolio</a>
        </li>
        <li>
          <a href="/about">About</a>
        </li>
        <li>
          <a href="/contact">Contact</a>
        </li>
        <li>
          <Button onClick={toggleModal}>Switch Theme</Button>
        </li>
        <li>
          <Button onClick={handleDarkModeToggle}>
            {isDarkMode ? 'Light Mode' : 'Dark Mode'}
          </Button>
        </li>
      </ul>
      {userName && <p className="nav-greeting">Hello, {userName}!</p>}
    </nav>
  );
};

export default Navigation;
